import React from "react";
import { Map, Marker, TileLayer} from 'react-leaflet'
import { Property } from "../../../../generated/graphql";
import { MAP_DEFAULT_FOCUS_LAT, MAP_DEFAULT_FOCUS_LONG } from "../../../../config";

interface Props {
     properties: Property[]
}



export const MapView: React.FC<Props> = (props) => {

     // const firstProp = props.properties[0];
     console.log(props.properties)

   return (
        <Map
        center= {{lat: MAP_DEFAULT_FOCUS_LAT ,lng: MAP_DEFAULT_FOCUS_LONG}}
        zoom= {10}
        doubleClickZoom= {false} 
        closePopupOnClick= {false} 
        dragging={false} 
        zoomSnap= {0} 
        zoomDelta= {0.5} 
        trackResize= {false}
        touchZoom= {false}
        scrollWheelZoom= {false}
        >
          <TileLayer
               url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
               attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          />       
               {props.properties.map((prop) => {
                         return <Marker
                              key={prop.id}
                              position={[
                                   prop.lat,
                                   prop.long
                              ]}
                              onClick={() => {

                              }}
                         />    
                    }
               )}

        </Map>
   )
}
